import React, { useEffect, useState } from 'react'
import axios from "axios"

export default function useData() {
    const [data, setData] = useState([])
    useEffect(async () => {
        let val = await axios.get("http://localhost:9000")
        let newVal = val.data.data
        setData(newVal)
    }, [])

    return [data]
}
